@ruanwenjun One question towards to whether we should remove
```
public static Map<String, String> toMap(String json) {
    return parseObject(json, new TypeReference<Map<String, String>>() {});
}
```
In this method, I personally think we can keep it here because it does not lose compiled type check, but 
`public static <K, V> Map<K, V> toMap(String json, Class<K> classK, Class<V> classV)` actually does lose that information.
